            "\n(IsNull(A1.U_HBT_Nombres,\'\') + \' \' + IsNull(A1.U_HBT_Apellido1,\'\') + \' \' + IsNu" +
            "ll(A1.U_HBT_Apellido2,\'\')) + \',\' +\r\nIsNull(SubString(A1.U_HBT_MunMed,1,2),\'\') + " +
