            "\r\n\'\' + \',\' + IsNull(A1.Address,\'\')  As \'Cadena\'\r\nFrom OINV A0 \r\nInner Join OCRD " +
            "A1 On A0.CardCode = A1.CardCode\r\nLeft Join \"@HBT_MUNICIPIO\" A2 On A1.U_HBT_MunMe" +
