            "de = T1.Code And T1.Code = (Select CardCode From OINV Where DocEntry = {0})\r\n\t\t\t" +
            "\t\tGROUP BY T1.Code, U_Codigo) A2 On A1.CardCode = A2.Code\r\nWhere A0.DocEntry = {" +
