            "rIndex(\'-\', A1.LicTradNum)+1, Len(A1.LicTradNum)) Else \'\' End As \'Cadena\'\r\nFrom " +
            "OINV A0 \r\nInner Join OCRD A1 On A0.CardCode = A1.CardCode\r\nWhere A0.DocEntry = {" +
