            "\nInner Join INV1 A1 On A0.DocEntry = A1.DocEntry\r\nInner Join INV4 A2 On A1.DocEn" +
            "try = A2.DocEntry And A1.LineNum = A2.LineNum And A2.ExpnsCode = -1\r\nWhere A0.Do" +
            "cEntry = {0}\r\nGroup By A0.DocCur\r\n\r\nUnion All\r\n\r\nSelect \'IMP\' + \',\' + IsNull(A2." +
