            "\',\' + \'\' + \',\' + \'\' + \',\' + \'\' As \'Cadena\'\r\nFrom OINV A0\r\nInner Join INV4 A1 On " +
            "A0.DocEntry = A1.DocEntry And A1.ExpnsCode = -1\r\nInner Join OSTC A2 On A1.StcCod" +
