            "ETributo\r\n\r\nUnion All\r\n\r\nSelect \'TIM\' + \',\' + \'true\' + \',\' + Cast(Cast(Round(Sum" +
            "(A1.WTAmnt),0,1) as decimal (15,0)) as Nvarchar(100)) + \',\' + \r\nCase When A0.Doc" +
            "Cur = \'$\' Then \'COP\' Else A0.DocCur End \'Cadena\'\r\nFrom OINV A0\r\nInner Join INV5 " +
            "A1 ON A0.DocEntry = A1.AbsEntry \r\nInner Join OWHT A2 On A1.WTCode = A2.WTCode\r\nW" +
